import * as React from "react";
import Button from "@mui/material/Button";
import TextField from "@mui/material/TextField";
import Dialog from "@mui/material/Dialog";
import DialogActions from "@mui/material/DialogActions";
import DialogContent from "@mui/material/DialogContent";
import DialogTitle from "@mui/material/DialogTitle";
import "../Dashboard.css";
import Student from "../images/Student.png";

const Internal = ({ open, handleClose, onSubmit }) => {
  const [user, setUser] = React.useState("");
  const [password, setPassword] = React.useState("");

  const handleData = (isSubmit) => {
    setUser("");
    setPassword("");

    if (isSubmit) {
      if (user === "" || password === "") {
        console.log("Please Enter User Name and Password");
      } else {
        onSubmit(user, password);
      }
    } else {
      handleClose();
    }
  };

  return (
    <div>
      <Dialog open={open} onClose={handleClose}>
        <img className="dialog-title" src={Student} alt="firespot" />
        <div className="title-heading">
          <DialogTitle className="sign-in">Sign In</DialogTitle>
          <DialogTitle className="uom-user">UOM User</DialogTitle>
        </div>
        <DialogContent>
            <DialogTitle>User Name</DialogTitle>
            <TextField
              autoFocus
              margin="dense"
              id="name"
              label="User Name"
              type="text"
              fullWidth
              variant="standard"
              onChange={(e) => setUser(e.target.value)}
              value={user}
            />
            <DialogTitle>Password</DialogTitle>
            <TextField
              margin="dense"
              id="password"
              label="Password"
              type="password"
              fullWidth
              variant="standard"
              onChange={(e) => setPassword(e.target.value)}
              value={password}
            />
        </DialogContent>

        <div className="signin">
          <DialogActions>
            <Button onClick={() => handleData(true)}>Signin</Button>
          </DialogActions>
        </div>
      </Dialog>
    </div>
  );
};
export default Internal;
